import React, { Suspense } from "react";
import { Route, Switch } from "react-router-dom";
// import { Container } from 'reactstrap';

// routes config
import routes from "../../routes";
// LIB
required("../../assets/js/jquery-3.3.1.min.js");
import "../../assets/js/jquery-ui.min.js" 
// import "../../assets/vendor/modernizr-3.5.0.js"
// import "../../assets/vendor/popper.min.js"
// import "../../assets/vendor/video/video.popup.js"
// import "../../assets/vendor/owlcarousel/owl.carousel.min.js"
// import "../../assets/vendor/menu/menumaker.js"
// import "../../assets/vendor/slick/swiper.min.js"
// import "../../assets/js/main.js"

const loading = () => <div>Loading...</div>;

// const DefaultAside = React.lazy(() => import("./DefaultAside"));
const DefaultFooter = React.lazy(() => import("./DefaultFooter"));
const DefaultHeader = React.lazy(() => import("./DefaultHeader"));

export default function DefaultLayout(props) {
  console.log("props", props);
  const signOut = e => {
    e.preventDefault();
    props.history.push("/login");
  };
  return (
    <div className="App">
      <header>
        <Suspense fallback={loading()}>
          <DefaultHeader onLogout={e => signOut(e)} />
        </Suspense>
      </header>
      <main className="main">
        <Suspense fallback={loading()}>
          <Switch>
            {routes.map((route, idx) => {
              return route.component ? (
                <Route
                  key={idx}
                  path={route.path}
                  exact={route.exact}
                  name={route.name}
                  render={props => <route.component {...props} />}
                />
              ) : null;
            })}
            {/* <Redirect from="/" to="/dashboard" /> */}
          </Switch>
        </Suspense>
      </main>
      <footer>
        <Suspense fallback={loading()}>
          <DefaultFooter />
        </Suspense>
      </footer>
    </div>
  );
}
